namespace Sample
{
  /// <summary>
  /// Constants
  /// </summary>
  public static class Constants
  {
        // Use these addresses in WinRT Clients
        public static string AzureBaseAddress = "https://arionapi-identityserver3-sandbox.azurewebsites.net";
        public static string AzureSwaggerWebApiSampleApi = "https://arionapi-identityserver3-sandbox.azurewebsites.net";

        public static string BaseAddress { get; set; } = AzureBaseAddress;
        
        // The OAuth2 authorize endpoint to get authentication-code
        public static string AuthorizeEndpoint => BaseAddress + "/connect/authorize";
        
        // The OAuth2 token endpoint, to receive token from
        public static string TokenEndpoint => BaseAddress + "/connect/token";

        // The registered id for the OAuth2 client:
        public static string ClientId => "FintechWPFSandboxClient";

        // The registered secret for the OAuth2 client:
        public static string ClientSecret => "secret";
        
        // The registered redirect url for the OAuth2 client:
        public static string ClientRedirectUrl => "oob://localhost/wpfclient";
        
        // Azure Developer key - needed to contact the webapi's in Azure
        public static string OcpApimSubscriptionKey => "[YourAzureDeveloperKeyGoesHere]";

        public const string ArionImage = "data:image/png;base64,";
  }
}